import Menu from "../../components/Menu";
import Footer from "../../components/Footer";
import { Container, Img } from "./style";
import picture from "../../assets/rebeca.png";

export default function Homepage() {
  return (
    <>
      <Menu></Menu>
      <Container>
        <p>
          Lorem ipsum dolor sit amet consectetur, adipisicing elit. Id dolores
          animi iure porro maiores, incidunt nulla commodi magnam laudantium
          nobis voluptatem! Veritatis, iusto. Rem recusandae eaque perspiciatis
          nisi facere voluptate!
        </p>
        <Img src={picture} alt="foto da rebeca" />
      </Container>
      <Footer></Footer>
    </>
  );
}
